import * as actionTypes from './types';
import {
  Planet, Vehicle, FalconeData, Result, Token,
} from '../types/types';

type SampleAction = {
  type: actionTypes.SAMPLE_ACTION;
  payload: string;
};
export const sampleAction = (payload: string): SampleAction => ({
  type: actionTypes.SAMPLE_ACTION,
  payload,
});

type SampleAction2 = {
  type: actionTypes.SAMPLE_ACTION2;
  payload: number;
};
export const sampleAction2 = (payload: number): SampleAction2 => ({
  type: actionTypes.SAMPLE_ACTION2,
  payload,
});
type FetchPlanets = {
  type:actionTypes.SET_PLANET_TO_STORE;
  payload:Planet[];
};
export const fetchPlanets = (payload:Planet[]):FetchPlanets => ({
  type: actionTypes.SET_PLANET_TO_STORE,
  payload,
});

type FetchVehicles = {
  type:actionTypes.SET_VEHICLES_TO_STORE;
  payload:Vehicle[];
};
export const fetchVehicles = (payload:Vehicle[]):FetchVehicles => ({
  type: actionTypes.SET_VEHICLES_TO_STORE,
  payload,
});

type GetToken ={
  type:actionTypes.GET_TOKEN;
  payload:Token;
};
export const getToken = (payload:Token):GetToken => ({
  type: actionTypes.GET_TOKEN,
  payload,
});
type GetResult ={
  type:actionTypes.FIND_FALCON;
  payload:Result;
};
export const getResult = (payload:Result):GetResult => ({
  type: actionTypes.FIND_FALCON,
  payload,
});


export type ReduxActions = SampleAction | SampleAction2 | FetchPlanets | FetchVehicles | GetToken | GetResult;

// export * from "./thunkActions"
